import React from 'react';
import { Code2, Braces, Palette, FileCode, Server, FileType, GitBranch, Globe, Clock, Database, Wrench, Zap, TestTube, Shield, Rocket, Link2, Bug, Star, Layers, Binary } from 'lucide-react';

function Home() {
  const topics = [
    { name: 'React Info', icon: Code2 },
    { name: 'JavaScript Info', icon: Braces },
    { name: 'CSS Basics', icon: Palette },
    { name: 'HTML Fundamentals', icon: FileCode },
    { name: 'Node.js', icon: Server },
    { name: 'TypeScript', icon: FileType },
    { name: 'Git & GitHub', icon: GitBranch },
    { name: 'Web APIs', icon: Globe },
    { name: 'Async/Await', icon: Clock },
    { name: 'State Management', icon: Database },
    { name: 'Hooks', icon: Wrench },
    { name: 'Performance', icon: Zap },
    { name: 'Testing', icon: TestTube },
    { name: 'Security', icon: Shield },
    { name: 'Deployment', icon: Rocket },
    { name: 'REST APIs', icon: Link2 },
    { name: 'Debugging', icon: Bug },
    { name: 'Best Practices', icon: Star },
    { name: 'Design Patterns', icon: Layers },
    { name: 'Data Structures', icon: Binary },
    { name: 'Algorithms', icon: Binary },
    { name: 'Databases', icon: Database }
  ];

  return (
    <div style={{ 
      minHeight: '100vh', 
      background: '#0a0a0a',
      color: '#989494',
      padding: '0'
    }}>
      {/* Hero Section */}
      <div style={{
        display: 'grid',
        margin: '20px',
        borderTop: '1px solid #333',
        borderBottom: '1px solid #333',
        gridTemplateColumns: 'repeat(4, 1fr)',
        gap: '15px',
        padding: '20px',
        height: '60vh',
        justifyItems: 'center',
        alignItems: 'center'
      }}>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>LEARN</h2>
          <p>Master the fundamentals</p>
        </div>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>BUILD</h2>
          <p>Create projects</p>
        </div>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>PRACTICE</h2>
          <p>Sharpen your skills</p>
        </div>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>GROW</h2>
          <p>Advance your career</p>
        </div>
      </div>

      {/* Topic Buttons Grid */}
      <div style={{
        display: 'grid',
        margin: '20px',
        border: '1px solid #333',
        gridTemplateColumns: 'repeat(7, 1fr)',
        gap: '15px',
        padding: '20px',
        borderRadius: '5px',
        justifyItems: 'center',
        alignItems: 'center'
      }}>
        {topics.map((topic, index) => {
          const Icon = topic.icon;
          return (
            <div
              key={index}
              style={{
                border: '1px solid #333',
                padding: '30px 50px',
                color: '#989494',
                borderRadius: '5px',
                cursor: 'pointer',
                textAlign: 'center',
                width: '100%',
                maxWidth: 'fit-content',
                background: '#0a0a0a',
                transition: 'all 0.3s ease',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                gap: '10px'
              }}
              onMouseEnter={(e) => {
                e.currentTarget.style.borderColor = '#666';
                e.currentTarget.style.color = '#fff';
              }}
              onMouseLeave={(e) => {
                e.currentTarget.style.borderColor = '#333';
                e.currentTarget.style.color = '#989494';
              }}
            >
              <Icon size={24} />
              {topic.name}
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default Home;
